function populateDropdown(elementId, options) {
    const dropdown = document.getElementById(elementId);

    dropdown.innerHTML = '';

    options.forEach(option => {
        const optionElement = document.createElement('option');
        optionElement.value = option;
        optionElement.textContent = option;
        dropdown.appendChild(optionElement);
    });
}

function updateModelle() {
    const selectedMarke = document.getElementById('marke').value;
    const modellDropdown = document.getElementById('modell');
    const baujahrDropdown = document.getElementById('baujahr');
    const motorDropdown = document.getElementById('motor');

    modellDropdown.disabled = true;
    baujahrDropdown.disabled = true;
    motorDropdown.disabled = true;

    if (selectedMarke) {
        const modelle = fahrzeuge.filter(fahrzeug => fahrzeug.marke === selectedMarke)
                                   .map(fahrzeug => fahrzeug.modell);

        populateDropdown('modell', ['Auswhlen', ...new Set(modelle)]);
        modellDropdown.disabled = false;
    } else {
        modellDropdown.innerHTML = '';
        baujahrDropdown.innerHTML = '';
        motorDropdown.innerHTML = '';
    }
}

function updateBaujahre() {
    const selectedMarke = document.getElementById('marke').value;
    const selectedModell = document.getElementById('modell').value;
    const baujahrDropdown = document.getElementById('baujahr');
    const motorDropdown = document.getElementById('motor');

    baujahrDropdown.disabled = true;
    motorDropdown.disabled = true;

    if (selectedMarke && selectedModell) {
        const baujahre = fahrzeuge.filter(fahrzeug => fahrzeug.marke === selectedMarke && fahrzeug.modell === selectedModell)
                                   .map(fahrzeug => fahrzeug.baujahr);

        populateDropdown('baujahr', ['Auswhlen', ...new Set(baujahre)]);
        baujahrDropdown.disabled = false;
    } else {
        baujahrDropdown.innerHTML = '';
        motorDropdown.innerHTML = '';
    }
}

function updateMotoren() {
    const selectedMarke = document.getElementById('marke').value;
    const selectedModell = document.getElementById('modell').value;
    const selectedBaujahr = document.getElementById('baujahr').value;
    const motorDropdown = document.getElementById('motor');

    motorDropdown.disabled = true;

    if (selectedMarke && selectedModell && selectedBaujahr) {
        const motoren = fahrzeuge.filter(fahrzeug => fahrzeug.marke === selectedMarke && fahrzeug.modell === selectedModell && fahrzeug.baujahr === selectedBaujahr)
                                 .map(fahrzeug => fahrzeug.motor);

        populateDropdown('motor', ['Auswhlen', ...new Set(motoren)]);
        motorDropdown.disabled = false;
    } else {
        motorDropdown.innerHTML = '';
    }
}

function berechnen() {
    const selectedMarke = document.getElementById('marke').value;
    const selectedModell = document.getElementById('modell').value;
    const selectedBaujahr = document.getElementById('baujahr').value;
    const selectedMotor = document.getElementById('motor').value;

    const fahrzeugTitel = `${selectedMarke} ${selectedModell} ${selectedBaujahr} ${selectedMotor}`;
    document.getElementById('fahrzeugTitel').textContent = fahrzeugTitel;

    const selectedFahrzeug = fahrzeuge.find(fahrzeug =>
        fahrzeug.marke === selectedMarke &&
        fahrzeug.modell === selectedModell &&
        fahrzeug.baujahr === selectedBaujahr &&
        fahrzeug.motor === selectedMotor
    );

    if (selectedFahrzeug) {
        document.getElementById('seriendaten').textContent = `Seriendaten: ${selectedFahrzeug.seriendaten}`;
        document.getElementById('optimierung').textContent = `MF Performance Stage 1: ${selectedFahrzeug.optimierung}`;
        document.getElementById('vmax').textContent = `Vmax Aufhebung: ${selectedFahrzeug.vmax}`;
        document.getElementById('mehrleistung').textContent = `Mehrleistung: ${selectedFahrzeug.mehrleistung}`;
        document.getElementById('upgrade').textContent = `Upgrade: ${selectedFahrzeug.upgrade}`;
        document.getElementById('preis').textContent = `Preis: ${selectedFahrzeug.preis}`;

        document.getElementById('ergebnisse').style.display = 'block';
    }
}

function resetAuswahl() {
    const markeDropdown = document.getElementById('marke');
    const modellDropdown = document.getElementById('modell');
    const baujahrDropdown = document.getElementById('baujahr');
    const motorDropdown = document.getElementById('motor');

    markeDropdown.value = '';
    modellDropdown.innerHTML = '<option value="" disabled selected>Auswhlen</option>';
    baujahrDropdown.innerHTML = '<option value="" disabled selected>Auswhlen</option>';
    motorDropdown.innerHTML = '<option value="" disabled selected>Auswhlen</option>';

    document.getElementById('ergebnisse').style.display = 'none';
}
